class Solution:    def getFolderNames(self, names: List[str]) -> List[str]:                dic = collections.defaultdict(int)        res = []                for name in names:            if name not in dic:                res.append(name)                dic[name] = 0            else:                cnt = dic[name]+1                while name+"("+str(cnt)+")" in dic:                    cnt += 1                res.append(name+"("+str(cnt)+")")                dic[name] = cnt                dic[name+"("+str(cnt)+")"] = 0                                                    return res                        